#include <bits/stdc++.h>
using namespace std;
int a[1005][1005];
int main (){
	int n,dir=0;
	scanf ("%d",&n);
	int dx[4]={1,0,-1,0},x=1;
	int dy[4]={0,-1,0,1},y=n;
	for (int i=1;i<=n*n;i++){
		a[x][y]=i;
		x+=dx[dir];
		y+=dy[dir];
		if (x<=0||x>n||y<=0||y>n||a[x][y]){
			x-=dx[dir];y-=dy[dir];
			dir=(dir+1)%4;
			x+=dx[dir];y+=dy[dir];
		}
	}
	for (int i=1;i<=n;i++){
		for (int j=1;j<=n;j++){
			printf ("%d ",a[i][j]);
		}
		puts("");
	}
	return 0;
}
